import React from "react";
import wordLib from "word-lib";

wordLib.exists("word")
function WordelLogic() {
    function CheckWord(){
        for(let i=0;i<10;i++){
            console.log(wordLib.random(5));
        }
    }
    return (
      <div>
      {CheckWord()}
      </div>
    );
  }

  export default WordelLogic;
